macro.rj_smtr.generate_km_columns.macro_sql:
{%- macro generate_km_columns() -%}
    {%- set tipos_query -%}
        select distinct
            status as tipo_viagem,
            regexp_replace(
                regexp_replace(
                    regexp_replace(
                        regexp_replace(
                            lower(
                                translate(
                                    status,
                                    'áàâãäéèêëíìîïóòôõöúùûüçÁÀÂÃÄÉÈÊËÍÌÎÏÓÒÔÕÖÚÙÛÜÇ',
                                    'aaaaaeeeeiiiiooooouuuucAAAAAEEEEIIIIOOOOOUUUUC'
                                )
                            ),
                            r'[^\w\s]',  -- Remove caracteres não alfanuméricos
                            ''
                        ),
                        r'\b(e|por|de)\b',
                        ''  -- Remove as palavras 'e', 'por' e 'de'
                    ),
                    r'(^nao|\bnao\b)',
                    'n'  -- Substitui 'nao' por 'n'
                ),
                r'[\s]+',
                '_'  -- Substitui múltiplos espaços por um único "_"
            ) as coluna_tipo_viagem
        from {{ ref("valor_km_tipo_viagem") }}
        {# from `rj-smtr.subsidio.valor_km_tipo_viagem` #}
        where
            status not in ("Não classificado", "Nao licenciado", "Licenciado sem ar")
            and status not like '%(023.II)%'
        order by status
    {%- endset -%}

    {%- set results = run_query(tipos_query) -%}

    {{ return(results) }}
{%- endmacro -%}

macro.rj_smtr.get_where_subquery.macro_sql:
{% macro get_where_subquery(relation) -%}
    {% set where = config.get("where") %}
    {% if where %}
        {% set re = modules.re %}
        {% set final_where = namespace(value=where) %}

        {% set matches = re.finditer("\{([^}]+)\}", where) %}

        {% for match in matches %}
            {% set var_name = match.group(1) %}
            {% set var_replace = "{" ~ var_name ~ "}" %}
            {% if var_name == "partitions" and var(var_name) == "" %}
                {% set partition_query %}
                    select
                        concat("'", parse_date("%Y%m%d", partition_id), "'") as particao
                    from
                        {{relation.database}}.{{relation.schema}}.INFORMATION_SCHEMA.PARTITIONS
                    where
                        table_name = "{{relation.identifier}}"
                        and partition_id != "__NULL__"
                        and datetime(last_modified_time, "America/Sao_Paulo") >= datetime("{{var('date_range_start')}}")
                        and datetime(last_modified_time, "America/Sao_Paulo") < datetime("{{var('date_range_end')}}")
                {% endset %}

                {% set partitions = run_query(partition_query).columns[0].values() %}
                {% set var_value = partitions | join(", ") %}
            {% else %} {% set var_value = var(var_name) %}
            {% endif %}
            {% set final_where.value = final_where.value.replace(
                var_replace, var_value
            ) %}
        {% endfor %}
        (select * from {{ relation }} where {{ final_where.value }})
    {%- else -%} {{ relation }}
    {%- endif -%}
{%- endmacro %}

macro.rj_smtr.generate_date_hour_partiti.macro_sql:
{% macro generate_date_hour_partition_filter(start_timestamp, end_timestamp) %}
    {% set start = modules.datetime.datetime.fromisoformat(start_timestamp) %}
    {% set end = modules.datetime.datetime.fromisoformat(end_timestamp) %}
    {% set days = (end.date() - start.date()).days %}

    {% if days == 0 %}
        data = date("{{ start_timestamp }}")
        and hora between {{ start.hour }} and {{ end.hour }}

    {% elif days == 1 %}
        (data = date("{{ start_timestamp }}") and hora >= {{ start.hour }})
        or (data = date("{{ end_timestamp }}") and hora <= {{ end.hour }})
    {% else %}
        (data = date("{{ start_timestamp }}") and hora >= {{ start.hour }})
        or (data > date("{{ start_timestamp }}") and data < date("{{ end_timestamp }}"))
        or (data = date("{{ end_timestamp }}") and hora <= {{ end.hour }})
    {% endif %}

{% endmacro %}

